Ext.data.JsonP['Dashboard_4.2.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.2.1</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-46238914\" class=\"content\">\n                        <h1>Dashboard 4.2.1</h1>\n    <p>Dashboard 4.2.1 is a patch release, which includes some behavior changes and bug fixes addressing high-priority issues from previous releases.    </p>\n    <p>    <span style=\"color: #2b4771;\">\nBehavior Changes    </span>\n    </p>\n<ul class=\" \"><li class=\" \">    <p>Removed the Feedback link from the footer.    </p>\n</li><li class=\" \">    <p>In the Arrow application Overview page, renamed &quot;Service URL&quot; to &quot;URL,&quot; and &quot;CNAME&quot; to &quot;DOMAIN.&quot;    </p>\n</li><li class=\" \">    <p>When you click on the service URL in the Arrow application Overview page, the service will open in a new browser window. Previously, the service would open in the same window as Dashboard.    </p>\n</li></ul>    <div class=\"section section-2 \" id=\"src-46238914_Dashboard4.2.1ReleaseNote-FixedIssues\">\n        <h2 class=\"heading \"><span>Fixed Issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed an issue where it took longer than expected to switch between organizations    </p>\n</li><li class=\" \">    <p>Fixed an issue where using a backslash (<tt class=\" \">\\</tt>) as part of the search term in the Apps menu would return a syntax error    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=46238914\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.2.1 Release Note"});